private String _write_feature_qualifier(String key, String value, boolean quote){
    String line = "";
    if (null == value) {
        line = QUALIFIER_INDENT_STR + "/" + key + lineSep;
        return line;
    }
    if (quote) {
        line = QUALIFIER_INDENT_STR + "/" + key + "=\"" + value + "\"";
    } else {
        line = QUALIFIER_INDENT_STR + "/" + key + "=" + value;
    }
    if (line.length() <= MAX_WIDTH) {
        return line + lineSep;
    }
    String goodlines = "";
