            k1 = (k1 << 23) | (k1 >>> 64 - 23);
            k1 *= c2;
            h1 ^= k1;
            h1 += h2;
            h2 = (h2 << 41) | (h2 >>> 64 - 41);
            k2 *= c2;
            k2 = (k2 << 23) | (k2 >>> 64 - 23);
